import { MainRomChat } from "./pages/MainRomChat";
import 'antd/dist/antd.css';
import { BrowserRouter, Router } from "react-router-dom";
import { Chatapp } from "./pages/Chatapp";

function App() {
  return (
    <BrowserRouter>
      <MainRomChat />
      <Router to="/chat-app" component={Chatapp}/>
    </BrowserRouter>
  );
}

export default App;
